import { Navbar, Nav, Container } from 'react-bootstrap';



function CustomNav() {
  return (

    <Navbar bg="dark" variant="dark" expand="lg">
        <Container>
            <Navbar.Brand><i className="fas fa-film"></i></Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Brand><Navbar.Collapse id="basic-navbar-nav">
                <Nav className="ml-auto">
                    <Nav.Link href="#1">Inicio</Nav.Link>
                    <Nav.Link href="#2">Acerca de</Nav.Link>
                    <Nav.Link href="#3">Contacto</Nav.Link>
                </Nav>
            </Navbar.Collapse></Navbar.Brand>
            <Navbar.Brand href="#">
                <input className='form-control' placeholder='Search movie'><span><button className='btn btn-outline-primary'> Search </button></span></input>
                
            </Navbar.Brand>

        </Container>
    </Navbar>

  );
}

export default CustomNav;
